      'swap.swaps': 'swap.swaps',
    }),
    new webpack.NoEmitOnErrorsPlugin(),
    new ProgressBarPlugin({ clear: false }),
    new WebappWebpackPlugin({
      logo: 'favicon.png',
      path: config.base,
      favicons: {
        appName: 'Wallet',
        appDescription: 'Hot wallet',
